  `queryItem` varchar(45) default NULL,
  `dataset` int(11) default NULL,
  `taskcol` varchar(45) default NULL,
  `gAstar` double default NULL,
  `equality` int(11) default '0' COMMENT 'this is for equality with keys',
  `assignmentId` varchar(100) default NULL,
  `hitId` varchar(100) default NULL,
  `workerId` varchar(100) default NULL,
  `hiturl` varchar(300) default NULL,
  `assginmentTime` datetime default NULL,
  PRIMARY KEY  (`id`)
